"use strict";(self.webpackChunkjohnycho_dev=self.webpackChunkjohnycho_dev||[]).push([[8130],{7735:n=>{n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"redis-distributed-lock","metadata":{"permalink":"/blog/redis-distributed-lock","source":"@site/blog/2025-12-08-redis-distributed-lock.mdx","title":"Redis Spin Lock\uc5d0\uc11c Redisson \uae30\ubc18 \ubd84\uc0b0\ub77d\uc73c\ub85c \uac1c\uc120\ud558\uae30","description":"\uc774\ubc88 \ud3ec\uc2a4\ud2b8\uc5d0\uc11c\ub294 Redis \uae30\ubc18\uc758 Spin Lock(SETNX + while-loop) \uad6c\uc870\ub97c Redisson \uae30\ubc18\uc758 Reentrant Distributed Lock\uc73c\ub85c \uc804\ud658\ud588\ub358 \uacbd\ud5d8\uc744 \uacf5\uc720\ud558\uace0\uc790 \ud569\ub2c8\ub2e4.","date":"2025-12-08T00:00:00.000Z","tags":[{"inline":true,"label":"redis","permalink":"/blog/tags/redis"}],"readingTime":6.47,"hasTruncateMarker":true,"authors":[{"name":"Johny Cho","title":"Back End Engineer @ NHN","url":"https://github.com/johnycho","page":{"permalink":"/blog/authors/johnycho"},"socials":{"github":"https://github.com/johnycho","instagram":"https://www.instagram.com/johny__cho","linkedin":"https://www.linkedin.com/in/johny-cho/"},"imageURL":"https://github.com/johnycho.png","key":"johnycho"}],"frontMatter":{"slug":"redis-distributed-lock","title":"Redis Spin Lock\uc5d0\uc11c Redisson \uae30\ubc18 \ubd84\uc0b0\ub77d\uc73c\ub85c \uac1c\uc120\ud558\uae30","authors":["johnycho"],"tags":["redis"]},"unlisted":false,"nextItem":{"title":"\uc138\ucee8\ub354\ub9ac \uc778\ub371\uc2a4\uc640 PK \uc778\ub371\uc2a4 \uac04 \ub370\ub4dc\ub77d, \uc65c \ubc1c\uc0dd\ud560\uae4c?","permalink":"/blog/index-deadlock"}},"content":"\x3c!-- truncate --\x3e\\n<br /><br />\\n\\n\uc774\ubc88 \ud3ec\uc2a4\ud2b8\uc5d0\uc11c\ub294 Redis \uae30\ubc18\uc758 Spin Lock(`SETNX` + while-loop) \uad6c\uc870\ub97c `Redisson` \uae30\ubc18\uc758 `Reentrant Distributed Lock`\uc73c\ub85c \uc804\ud658\ud588\ub358 \uacbd\ud5d8\uc744 \uacf5\uc720\ud558\uace0\uc790 \ud569\ub2c8\ub2e4.\\n\\n## \uae30\uc874 Spin Lock \uad6c\uc870\\n```java\\npublic <T> T executeInSpinLock(String lockKey, Supplier<T> supplier) {\\n    while (Boolean.FALSE.equals(acquireLock(lockKey))) {\\n      log.info(\\"sleep to acquire distributed lock (lock key = {})\\", lockKey);\\n      ThreadUtil.sleep(100, TimeUnit.MILLISECONDS);\\n    }\\n\\n    try {\\n      return supplier.get();\\n    } catch (Exception e) {\\n      errorNotifier.sendErrorMessage(\\"error occurs in executing task in lock\\", e);\\n      throw e;\\n    } finally {\\n      eventPublisher.publishEvent(RedisUnlockEvent.of(lockKey));\\n    }\\n  }\\n\\n@TransactionalEventListener(phase = TransactionPhase.AFTER_COMPLETION, fallbackExecution = true)\\npublic void releaseLock(RedisUnlockEvent event) {\\n  if (lockContextHolder.isEmpty()) {\\n    return;\\n  }\\n\\n  retry(() -> {\\n    final Boolean releaseDistributedLock = redisTemplate.delete(event.getLockKey());\\n    if (Boolean.TRUE.equals(releaseDistributedLock)) {\\n      lockContextHolder.clear();\\n    }\\n    return null;\\n  });\\n}\\n\\nprivate Boolean acquireLock(String lockKey) {\\n  if (lockContextHolder.hasAlreadyAcquireDistributedLock(lockKey)) {\\n    log.info(\\"accessing the critical section within the same thread. (lock key = {})\\", lockKey);\\n    return true;\\n  }\\n\\n  return retry(() -> {\\n    final Boolean acquireDistributedLock = redisTemplate.opsForValue().setIfAbsent(lockKey, StringUtils.EMPTY, Duration.ofMinutes(1));\\n    if (Boolean.TRUE.equals(acquireDistributedLock)) {\\n      lockContextHolder.setValue(lockKey);\\n    }\\n    return acquireDistributedLock;\\n  });\\n}\\n\\nprivate <T> T retry(Supplier<T> supplier) {\\n  try {\\n    return retryTemplate.execute(context -> supplier.get());\\n  } catch (Exception e) {\\n    errorNotifier.sendErrorMessage(\\"fail in retry\\", e);\\n    throw e;\\n  }\\n}\\n```\\n\uae30\uc874 \ucf54\ub4dc\ub294 \ub2e4\uc74c\uacfc \uac19\uc740 \ubc29\uc2dd\uc73c\ub85c \ubd84\uc0b0\ub77d\uc744 \uad6c\ud604\ud558\uace0 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n- Redis `SETNX`(setIfAbsent) \u2192 \ub77d \ud68d\ub4dd\\n- \ub77d\uc744 \uc5bb\uc744 \ub54c\uae4c\uc9c0 `while(false)`\ub85c \ubc18\ubcf5 (100ms sleep)\\n- \ub77d\uc744 \ud68d\ub4dd\ud558\uba74 \ube44\uc988\ub2c8\uc2a4 \ub85c\uc9c1 \uc218\ud589\\n- \ud2b8\ub79c\uc7ad\uc158\uc774 \ub05d\ub09c \ub4a4(`AFTER_COMPLETION`) \uc774\ubca4\ud2b8 \uae30\ubc18\uc73c\ub85c \ub77d \ud574\uc81c\\n\\n\uc5ec\uae30\uc11c \ubb38\uc81c\uac00 \ub418\ub294 \ud575\uc2ec \uad6c\ud604\uc740 \uc544\ub798 \ubd80\ubd84\uc785\ub2c8\ub2e4.\\n```java\\nwhile (Boolean.FALSE.equals(acquireLock(lockKey))) {\\n    log.info(\\"sleep to acquire distributed lock (lock key = {})\\", lockKey);\\n    ThreadUtil.sleep(100, TimeUnit.MILLISECONDS);\\n}\\n```\\n\ub77d\uc744 \ud68d\ub4dd\ud558\ub294 \uacfc\uc815\uc5d0\uc11c \ub0b4\ubd80\uc801\uc73c\ub85c Redis\uc5d0 \ub2e4\uc74c\uacfc \uac19\uc740 \ucee4\ub9e8\ub4dc\ub97c \uacc4\uc18d \ub0a0\ub9bd\ub2c8\ub2e4.\\n```redis\\nSET key value NX EX 60\\n```\\n\ub77d\uc774 \uc774\ubbf8 \uc788\ub2e4\uba74 \u2192 \uc2e4\ud328 \u2192 sleep \u2192 \ub2e4\uc2dc `SETNX`  \\n\uc774 \uacfc\uc815\uc774 \ub77d\uc744 \uc5bb\uc744 \ub54c\uae4c\uc9c0 \ubb34\ud55c \ubc18\ubcf5\ub429\ub2c8\ub2e4.\\n\\n### \uae30\uc874 Spin Lock \uad6c\uc870\uc758 \ubb38\uc81c\uc810\\n1) Redis \ubd80\ud558 \uc99d\uac00 (Polling \uae30\ubc18 \uad6c\uc870)  \\n   \uc2a4\ub808\ub4dc\uac00 \uc7a0\ub4e4\uc5c8\ub2e4 \uae68\uba70 \ub9e4 100ms\ub9c8\ub2e4 `SETNX`\ub97c \ud638\ucd9c\ud568  \\n   \ud2b9\ud788 \ub77d\uc774 \uc624\ub798 \uc720\uc9c0\ub418\uba74, Redis\ub294 <mark>\ubd88\ud544\uc694\ud55c \ud2b8\ub798\ud53d\uc744 \uacc4\uc18d \ubc1b\uc74c</mark>\\n2) Spin Lock\uc740 <mark>CPU \ud6a8\uc728\uc774 \uc88b\uc9c0 \uc54a\uc74c</mark>  \\n   100ms sleep\uc744 \ud574\ub3c4 \uacb0\uad6d \ud3f4\ub9c1 \uae30\ubc18\uc774\ub77c, \ubd88\ud544\uc694\ud558\uac8c \uc2a4\ub808\ub4dc\ub97c \uae68\uc6b0\uace0 put/get\uc744 \ubc18\ubcf5\ud558\uac8c \ub428\\n3) \uc7ac\uc9c4\uc785(`Reentrant`) \ub77d\uc774 \uc544\ub2d8 \u2192 `ThreadLocal`\ub85c \uc5b5\uc9c0 \uad6c\ud604  \\n   \uc911\ucca9 \ud638\ucd9c\uc744 \uc9c0\uc6d0\ud558\uae30 \uc704\ud574 `LockContextHolder`\ub85c `ThreadLocal`\uc744 \ud65c\uc6a9\ud558\uc9c0\ub9cc \ud55c\uacc4\uc810 \uc874\uc7ac\\n   - \ub204\uc218 \uc704\ud5d8 \uc788\uc74c\\n   - \uc5ec\ub7ec \ud0a4\ub97c \ub3d9\uc2dc\uc5d0 \uc7a1\ub294 \uc0c1\ud669\uc5d0\uc11c \ud655\uc7a5\uc774 \uc5b4\ub824\uc6c0\\n   - `Redisson`\uc758 \uc7ac\uc9c4\uc785 \ub77d\uc5d0 \ube44\ud558\uba74 \uae30\ub2a5\uc801\uc73c\ub85c \ub9ce\uc774 \ubd80\uc871\ud568\\n4) \ub77d \ub9cc\ub8cc(expire)\uc640 \uc2e4\uc81c unlock \ud0c0\uc774\ubc0d\uc774 \ub9de\uc9c0 \uc54a\uc744 \uc704\ud5d8  \\n   <mark>\ud2b8\ub79c\uc7ad\uc158 \uae38\uc774\uac00 \uc608\uc0c1\ubcf4\ub2e4 \uae38\uc5b4\uc9c0\uba74 TTL(`SETNX` expire)\uc774 \uba3c\uc800 \ub9cc\ub8cc\ub420 \uc218 \uc788\uc74c</mark> (\ub77d \uc548\uc815\uc131\uc774 TTL\uc5d0 \ub108\ubb34 \uc758\uc874)\\n\\n## `Redisson` \uae30\ubc18 \ubd84\uc0b0\ub77d\uc73c\ub85c \uac1c\uc120\ud558\uae30\\n`Redisson`\uc740 \ub2e4\uc74c \uae30\ub2a5\uc744 \uae30\ubcf8 \uc9c0\uc6d0\ud569\ub2c8\ub2e4.\\n- Redis \uae30\ubc18 Reentrant Lock(\uc7ac\uc9c4\uc785 \uac00\ub2a5)\\n- Pub/Sub \uae30\ubc18 \ub77d \ub300\uae30 \u2192 Spin Lock \uc81c\uac70\\n- TTL + Watchdog \uae30\ubc18 \uc790\ub3d9 \uc5f0\uc7a5\\n- \ubd84\uc0b0 \ud658\uacbd\uc5d0\uc11c \uc548\uc804\ud558\uac8c \ub3d9\uc791\\n\\n### \ucd5c\uc885 \uac1c\uc120 \ucf54\ub4dc\\n```java\\n@Service\\n@RequiredArgsConstructor\\n@Slf4j\\npublic class RedissonDistributedLockService {\\n\\n  private final RedissonClient redissonClient;\\n  private final ApplicationEventPublisher eventPublisher;\\n  private final ErrorNotifier errorNotifier;\\n\\n  public <T> T executeWithRedissonLock(String lockKey, Supplier<T> supplier) {\\n    RLock lock = null;\\n\\n    try {\\n      lock = acquireLock(lockKey, 30, TimeUnit.SECONDS);\\n\\n      return supplier.get();\\n\\n    } catch (Exception e) {\\n      errorNotifier.sendErrorMessage(\\"error occurs in executing task in redisson lock\\", e);\\n      throw e;\\n\\n    } finally {\\n      // unlock\uc740 AFTER_COMPLETION\uc5d0\uc11c \uc2e4\ud589\\n      if (lock != null) {\\n        eventPublisher.publishEvent(RedissonUnlockEvent.of(lockKey));\\n      }\\n    }\\n  }\\n\\n  private RLock acquireLock(String lockKey, long leaseTime, TimeUnit unit) {\\n    RLock lock = redissonClient.getLock(lockKey);\\n    lock.lock(); // leaseTime \uc9c0\uc815 X (watchdog \ub3d9\uc791)\\n    // lock.lock(leaseTime, unit); // \ubb34\ud55c \ub300\uae30 + leaseTime\uc774 \uc9c0\ub098\uba74 \uac15\uc81c\ub85c \ub77d\uc774 \ud574\uc81c\ub428\\n    log.info(\\"acquired redisson lock. key={}\\", lockKey);\\n    return lock;\\n  }\\n\\n  @TransactionalEventListener(\\n      phase = TransactionPhase.AFTER_COMPLETION,\\n      fallbackExecution = true\\n  )\\n  public void releaseLock(RedissonUnlockEvent event) {\\n    RLock lock = redissonClient.getLock(event.getLockKey());\\n\\n    try {\\n      if (lock.isHeldByCurrentThread()) {\\n        lock.unlock();\\n        log.info(\\"released redisson lock. key={}\\", event.getLockKey());\\n      }\\n    } catch (Exception e) {\\n      log.error(\\"failed to unlock redisson lock. key={}\\", event.getLockKey(), e);\\n    }\\n  }\\n}\\n```\\n\\n### \uac1c\uc120 \uacb0\uacfc\\n1) <mark>Redis \ubd80\ud558 \uac10\uc18c</mark> (Polling \u2192 Pub/Sub \uae30\ubc18)  \\n   Spin Lock \uc81c\uac70\ub85c Redis \ud2b8\ub798\ud53d\uc774 \ud06c\uac8c \uac10\uc18c\\n2) \ub77d \ud68d\ub4dd \ud6a8\uc728 \uc99d\uac00  \\n   `Redisson`\uc740 Redis Pub/Sub \uc744 \ud65c\uc6a9\ud574 \uc774\ubca4\ud2b8 \uae30\ubc18\uc73c\ub85c \ub77d\uc744 \uae30\ub2e4\ub9bc  \\n   \u2192 \ub77d\uc774 \ud480\ub9b4 \ub54c\uae4c\uc9c0 \uc870\uc6a9\ud788 \ub300\uae30  \\n   \u2192 <mark>CPU \uc0ac\uc6a9\ub7c9 \uac10\uc18c</mark>\\n3) <mark>\uc7ac\uc9c4\uc785(Reentrant) \ub77d \ub0b4\uc7a5</mark> \u2192 `ThreadLocal` \uc81c\uac70  \\n   `Redisson`\uc758 \ub77d\uc740 \ub3d9\uc77c \uc2a4\ub808\ub4dc\uc5d0\uc11c \uc5ec\ub7ec \ubc88 \ud638\ucd9c\ud574\ub3c4 \uc790\ub3d9\uc73c\ub85c hold count \uad00\ub9ac  \\n   \u2192 `ThreadLocal` \uad00\ub9ac \ucf54\ub4dc \uc644\uc804\ud788 \uc81c\uac70  \\n   \u2192 \ub77d \uc548\uc815\uc131 \uc99d\uac00  \\n   \u2192 \uc911\ucca9 \uad6c\uc870\ub3c4 \uc27d\uac8c \ud45c\ud604 \uac00\ub2a5\\n4) Watchdog \uc0ac\uc6a9 \ud328\ud134(TTL\uc790\ub3d9 \uc5f0\uc7a5)\uc73c\ub85c \uc548\uc815\uc131 \uc99d\uac00  \\n   `Redisson` lock\uc740 <mark>watchdog\uc744 \ud1b5\ud574 \ub77d\uc744 \uc8fc\uae30\uc801\uc73c\ub85c \uc5f0\uc7a5</mark>\ud560 \uc218 \uc788\uc74c  \\n   \ube44\uc988\ub2c8\uc2a4 \ub85c\uc9c1\uc774 \uae38\uc5b4\uc838\ub3c4 \ub77d\uc774 \uba3c\uc800 expire\ub418\uc9c0 \uc54a\uc544 \ud2b8\ub79c\uc7ad\uc158 \ub3d9\uc548\uc5d0 \ub77d\uc774 \uc720\uc9c0\ub428  \\n   \u2192 \uc2a4\ub808\ub4dc\uac00 \uc0b4\uc544\uc788\ub294 \ub3d9\uc548 \ud2b8\ub79c\uc7ad\uc158 \ub05d\ub0a0 \ub54c\uae4c\uc9c0 watchdog\uc774 \uacc4\uc18d \ub77d\uc744 \uc720\uc9c0\\n\\n---\\n\\n## \ub9c8\uce58\uba70\\nRedis\uc5d0\uc11c \uc9c1\uc811 `SETNX`\ub85c \ub77d\uc744 \uad6c\ud604\ud558\uace0, \uc2a4\ud540\ub77d\uc73c\ub85c \ubc18\ubcf5 \ud655\uc778\ud558\uace0, TTL\uacfc \ud2b8\ub79c\uc7ad\uc158 \ud0c0\uc774\ubc0d\uc744 \uc218\ub3d9\uc73c\ub85c \ub9de\ucd94\ub358 \ucf54\ub4dc\uc640 \ube44\uad50\ud558\uba74  \\n`Redisson`\uc740 \ubd84\uc0b0\ub77d\uc744 \ud6e8\uc52c \ub354 \uc548\uc804\ud558\uace0, \uac04\uacb0\ud558\uac8c \uad00\ub9ac\ud560 \uc218 \uc788\ub294 \ub3c4\uad6c\uc785\ub2c8\ub2e4.\\n\\n\uc9c1\uc811 \uad6c\ud604\ud558\ub824\uba74 \ubcf5\uc7a1\ud574\uc9c8 \ubaa8\ub4e0 \uae30\ub2a5\uc744 `Redisson`\uc774 \uc77c\uad00\ub41c \ubc29\uc2dd\uc73c\ub85c \uc81c\uacf5\ud569\ub2c8\ub2e4.  \\n- \uc7ac\uc9c4\uc785(Reentrant) \ub77d\\n- Pub/Sub \uae30\ubc18 \ub300\uae30\\n- \uc790\ub3d9 \uc5f0\uc7a5\uc744 \uc704\ud55c watchdog\\n- Lua \uc2a4\ud06c\ub9bd\ud2b8\ub97c \ud1b5\ud55c \uc6d0\uc790\uc801 \ub77d \uad00\ub9ac"},{"id":"index-deadlock","metadata":{"permalink":"/blog/index-deadlock","source":"@site/blog/2025-11-06-index-deadlock.mdx","title":"\uc138\ucee8\ub354\ub9ac \uc778\ub371\uc2a4\uc640 PK \uc778\ub371\uc2a4 \uac04 \ub370\ub4dc\ub77d, \uc65c \ubc1c\uc0dd\ud560\uae4c?","description":"MySQL InnoDB\uc5d0\uc11c,","date":"2025-11-06T00:00:00.000Z","tags":[{"inline":false,"label":"MySQL","permalink":"/blog/tags/mysql","description":"MySQL tag description"}],"readingTime":4.66,"hasTruncateMarker":true,"authors":[{"name":"Johny Cho","title":"Back End Engineer @ NHN","url":"https://github.com/johnycho","page":{"permalink":"/blog/authors/johnycho"},"socials":{"github":"https://github.com/johnycho","instagram":"https://www.instagram.com/johny__cho","linkedin":"https://www.linkedin.com/in/johny-cho/"},"imageURL":"https://github.com/johnycho.png","key":"johnycho"}],"frontMatter":{"slug":"index-deadlock","title":"\uc138\ucee8\ub354\ub9ac \uc778\ub371\uc2a4\uc640 PK \uc778\ub371\uc2a4 \uac04 \ub370\ub4dc\ub77d, \uc65c \ubc1c\uc0dd\ud560\uae4c?","authors":["johnycho"],"tags":["mysql"]},"unlisted":false,"prevItem":{"title":"Redis Spin Lock\uc5d0\uc11c Redisson \uae30\ubc18 \ubd84\uc0b0\ub77d\uc73c\ub85c \uac1c\uc120\ud558\uae30","permalink":"/blog/redis-distributed-lock"},"nextItem":{"title":"Spring Cloud Config\uc758 \ubcf5\ud638\ud654 \uc2e4\ud328 \ucc98\ub9ac \uacfc\uc815 \u2014 {cipher}...\uac00 invalid.*\ub85c \ubc14\ub00c\ub294 \uc774\uc720","permalink":"/blog/spring-cloud-config-decrypt"}},"content":"\x3c!-- truncate --\x3e\\n<br /><br />\\n\\n# \uc138\ucee8\ub354\ub9ac \uc778\ub371\uc2a4\uc640 PK \uc778\ub371\uc2a4 \uac04 \ub370\ub4dc\ub77d, \uc65c \ubc1c\uc0dd\ud560\uae4c?\\nMySQL `InnoDB`\uc5d0\uc11c,  \\n`UPDATE`, `DELETE`, `SELECT ... FOR UPDATE` \ub4f1\uc73c\ub85c <mark>\ub808\ucf54\ub4dc\ub97c \uc7a0\uae00 \ub54c\\nPK \uc778\ub371\uc2a4 \ubfd0 \uc544\ub2c8\ub77c \uc138\ucee8\ub354\ub9ac \uc778\ub371\uc2a4\uae4c\uc9c0 \ub77d\uc774 \uac78\ub9ac\uba74\uc11c</mark> \uad50\ucc29 \uc0c1\ud0dc(Deadlock)\uac00 \ubc1c\uc0dd\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n`InnoDB`\ub294 \ubcf4\uc870 \uc778\ub371\uc2a4\ub97c \ud1b5\ud574 \uc811\uadfc\ud558\ub354\ub77c\ub3c4 \uc2e4\uc81c \ub77d\uc740 PK \uae30\ubc18\uc73c\ub85c \uac78\uae30 \ub54c\ubb38\uc5d0,  \\n\uc138\ucee8\ub354\ub9ac \uc778\ub371\uc2a4\uc640 PK \uc778\ub371\uc2a4\uac00 \uc11c\ub85c \ub2e4\ub978 \ud2b8\ub79c\uc7ad\uc158\uc5d0\uc11c \uc5c7\uac08\ub824 \ub77d\uc744 \uac78\uba74 \ub370\ub4dc\ub77d\uc774 \uc0dd\uae41\ub2c8\ub2e4.\\n\\n## MySQL\uc758 \ub77d \ub3d9\uc791 \uba54\ucee4\ub2c8\uc998\\n`InnoDB`\ub294 `Row-Level Lock`\ucc98\ub7fc \ubcf4\uc5ec\ub3c4 \ub0b4\ubd80\uc801\uc73c\ub85c\ub294 <mark>**\uc778\ub371\uc2a4 \ub808\ucf54\ub4dc \uae30\ubc18\uc758 \uc7a0\uae08**</mark> (`Record Lock`)\\n\\n## \uc608\uc81c \uc2dc\ub098\ub9ac\uc624\\n```sql\\nCREATE TABLE user_balance (\\n  id BIGINT PRIMARY KEY,\\n  user_id BIGINT,\\n  balance INT,\\n  KEY idx_user (user_id)\\n) ENGINE=InnoDB;\\n```\\n\\n### \ud2b8\ub79c\uc7ad\uc158 A\\n```sql\\nBEGIN;\\nSELECT * FROM user_balance WHERE user_id = 100 FOR UPDATE;\\n-- \u2192 \uc138\ucee8\ub354\ub9ac \uc778\ub371\uc2a4(idx_user)\ub85c \ud0d0\uc0c9 \ud6c4, PK lookup \uc218\ud589\\n-- \u2192 (\uc138\ucee8\ub354\ub9ac \ub77d \u2192 PK \ub77d) \uc21c\uc11c\ub85c \ub77d \ud68d\ub4dd\\n```\\n\\n### \ud2b8\ub79c\uc7ad\uc158 B\\n```sql\\nBEGIN;\\nUPDATE user_balance SET balance = balance + 10 WHERE id = 10;\\n-- \u2192 PK \uc778\ub371\uc2a4\ub85c \uc9c1\uc811 \uc811\uadfc\\n-- \u2192 (PK \ub77d) \uba3c\uc800 \ud68d\ub4dd\\n```\\n\\n\uc774 \uc0c1\ud0dc\uc5d0\uc11c A\uc640 B\uac00 \ub3d9\uc77c\ud55c row\ub97c \uac00\ub9ac\ud0a4\ub294 PK\ub97c \uac01\uc790 \ub2e4\ub978 \uc778\ub371\uc2a4 \uacbd\ub85c\ub85c \uc811\uadfc\ud558\uba74,\\n\uc11c\ub85c\uac00 \uc0c1\ub300\uc758 \ub77d\uc744 \uae30\ub2e4\ub9ac\uba70 \ub370\ub4dc\ub77d\uc774 \ubc1c\uc0dd\ud569\ub2c8\ub2e4.\\n\\n### \ub0b4\ubd80 \ub77d \ud50c\ub85c\uc6b0 \ubd84\uc11d\\n<table>\\n  <tr><th>\uc21c\uc11c</th><th>A (\uc138\ucee8\ub354\ub9ac \uc778\ub371\uc2a4 \uacbd\ub85c)</th><th>B (PK \uacbd\ub85c)</th></tr>\\n  <tr><td style={{ textAlign: \'center\' }}>1</td><td>`idx_user` \uc778\ub371\uc2a4 \ud0d0\uc0c9 (Record Lock)</td><td>PK = 10 Row Lock</td></tr>\\n  <tr><td style={{ textAlign: \'center\' }}>2</td><td>PK lookup\uc73c\ub85c \uc804\ud658\ud558\ub824 \ud568</td><td>\uc774\ubbf8 B\uac00 PK \ub77d\uc744 \uc120\uc810</td></tr>\\n  <tr><td style={{ textAlign: \'center\' }}>3</td><td>\ub300\uae30 \uc0c1\ud0dc \uc9c4\uc785</td><td>A\uac00 `idx_user` \ub77d\uc744 \uc120\uc810 \uc911</td></tr>\\n  <tr><td style={{ textAlign: \'center\' }}>4</td><td colSpan={2} style={{ textAlign: \'center\' }}>\uc11c\ub85c \uc0c1\ub300 \ub77d\uc744 \uae30\ub2e4\ub9ac\uba70 Deadlock</td></tr>\\n</table>\\n\uc989, <mark>\ub77d \ud68d\ub4dd \uc21c\uc11c \ubd88\uc77c\uce58 (Lock Ordering Inconsistency) \uac00 \ub370\ub4dc\ub77d\uc758 \ud575\uc2ec \uc6d0\uc778</mark>\uc785\ub2c8\ub2e4.\\n\\n<table>\\n  <thead>\\n    <tr>\\n      <th style={{ whiteSpace: \'nowrap\', textAlign: \'center\' }}>\uc21c\uc11c</th>\\n      <th>\ud2b8\ub79c\uc7ad\uc158 A</th>\\n      <th>\ud2b8\ub79c\uc7ad\uc158 B</th>\\n    </tr>\\n  </thead>\\n  <tbody>\\n    <tr>\\n      <td style={{ textAlign: \'center\' }}>1</td>\\n      <td><code>idx_user</code> \ub77d \ud68d\ub4dd</td>\\n      <td></td>\\n    </tr>\\n    <tr>\\n      <td style={{ textAlign: \'center\' }}>2</td>\\n      <td>PK\ub85c lookup \uc2dc\ub3c4, \ud558\uc9c0\ub9cc B\uac00 \uc774\ubbf8 PK \ub77d \ubcf4\uc720</td>\\n      <td></td>\\n    </tr>\\n    <tr>\\n      <td style={{ textAlign: \'center\' }}>3</td>\\n      <td>\ub300\uae30 \uc0c1\ud0dc</td>\\n      <td>PK \ub77d \ubcf4\uc720 \uc911</td>\\n    </tr>\\n    <tr>\\n      <td style={{ textAlign: \'center\' }}>4</td>\\n      <td></td>\\n      <td>B\ub294 \uc5c5\ub370\uc774\ud2b8 \uc911, PK \ub77d\uc744 \uac00\uc9c4 \uc0c1\ud0dc\ub85c \ub0b4\ubd80\uc801\uc73c\ub85c \uc778\ub371\uc2a4 \uc815\ud569\uc131 \uc720\uc9c0 \uc704\ud574 <code>idx_user</code> \uac31\uc2e0 \ud544\uc694</td>\\n    </tr>\\n    <tr>\\n      <td style={{ textAlign: \'center\' }}>5</td>\\n      <td></td>\\n      <td>\uadf8\ub7f0\ub370 <code>idx_user</code>\ub294 A\uac00 \ub77d\uc744 \uc7a1\uace0 \uc788\uc74c</td>\\n    </tr>\\n    <tr>\\n      <td style={{ textAlign: \'center\' }}>6</td>\\n      <td>\ud83d\udea8 \uad50\ucc29 \ubc1c\uc0dd</td>\\n      <td>\ud83d\udea8 \uad50\ucc29 \ubc1c\uc0dd</td>\\n    </tr>\\n  </tbody>\\n</table>\\n\\n## \ud2b8\ub79c\uc7ad\uc158 B\ub294 PK\ub85c\ub9cc \uc811\uadfc\ud588\ub294\ub370 \uc65c \uc138\ucee8\ub354\ub9ac \uc778\ub371\uc2a4(`idx_user`) \ub77d\uc744 \uae30\ub2e4\ub9b4\uae4c?\\n`InnoDB`\ub294 UPDATE \uc2dc <mark>PK\ubfd0\ub9cc \uc544\ub2c8\ub77c \ubaa8\ub4e0 \uad00\ub828 \uc778\ub371\uc2a4\uc758 \uc5d4\ud2b8\ub9ac\ub3c4 \uc218\uc815\ud574\uc57c \ud558\uae30 \ub54c\ubb38</mark>\uc785\ub2c8\ub2e4.\\n> UPDATE user_balance SET balance = ...   \\n> \u2192 PK \ud14c\uc774\ube14 \ud398\uc774\uc9c0 \uc218\uc815\ubfd0\ub9cc \uc544\ub2c8\ub77c  \\n> \u2192 \uc138\ucee8\ub354\ub9ac \uc778\ub371\uc2a4(idx_user)\uc758 \ud574\ub2f9 \uc5d4\ud2b8\ub9ac\ub3c4 \ubcc0\uacbd\ub418\uc5b4\uc57c \ud568 (user_id\uac00 \ubcc0\ud558\uc9c0 \uc54a\ub354\ub77c\ub3c4 consistency \uc720\uc9c0 \uc704\ud574 latch \ud68d\ub4dd \ud544\uc694)\\n\\n\uc774\ub54c, \uc774\ubbf8 \ud2b8\ub79c\uc7ad\uc158 A\uac00 idx_user\uc5d0\uc11c \uc7a0\uae08\uc744 \uac00\uc9c0\uace0 \uc788\uc73c\ubbc0\ub85c,  \\nB\ub294 \uadf8 \uc138\ucee8\ub354\ub9ac \uc778\ub371\uc2a4 \uc5d4\ud2b8\ub9ac\uc5d0 \ub300\ud55c latch/lock\uc744 \uae30\ub2e4\ub9ac\uac8c \ub429\ub2c8\ub2e4.\\n\\nB\ub294 `user_id` \uc778\ub371\uc2a4\ub97c \uc9c1\uc811 \uc870\ud68c\ud558\uc9c0 \uc54a\uc558\ub354\ub77c\ub3c4,  \\nUPDATE \ubb38\uc774 \ub0b4\ubd80\uc801\uc73c\ub85c `idx_user` \uc778\ub371\uc2a4 \ud398\uc774\uc9c0\ub97c \uac31\uc2e0\ud574\uc57c \ud558\uae30 \ub54c\ubb38\uc5d0  \\nA\uac00 \uc7a1\uc740 `idx_user` \ub77d\uc5d0 \ub9c9\ud600 \ub300\uae30\ud558\ub2e4\uac00 \uad50\ucc29(deadlock)\uc774 \ubc1c\uc0dd\ud558\ub294 \uac83\uc785\ub2c8\ub2e4.\\n\\n## \ub370\ub4dc\ub77d \ub85c\uadf8 \ud655\uc778 \ubc29\ubc95\\n```sql\\nSHOW ENGINE INNODB STATUS\\\\G\\n```"},{"id":"spring-cloud-config-decrypt","metadata":{"permalink":"/blog/spring-cloud-config-decrypt","source":"@site/blog/2025-11-06-spring-cloud-config-decrypt.mdx","title":"Spring Cloud Config\uc758 \ubcf5\ud638\ud654 \uc2e4\ud328 \ucc98\ub9ac \uacfc\uc815 \u2014 {cipher}...\uac00 invalid.*\ub85c \ubc14\ub00c\ub294 \uc774\uc720","description":"Spring Cloud Config Server\ub97c \uc4f0\ub2e4 \ubcf4\uba74,","date":"2025-11-06T00:00:00.000Z","tags":[{"inline":false,"label":"Spring","permalink":"/blog/tags/spring","description":"Spring tag description"}],"readingTime":3.145,"hasTruncateMarker":true,"authors":[{"name":"Johny Cho","title":"Back End Engineer @ NHN","url":"https://github.com/johnycho","page":{"permalink":"/blog/authors/johnycho"},"socials":{"github":"https://github.com/johnycho","instagram":"https://www.instagram.com/johny__cho","linkedin":"https://www.linkedin.com/in/johny-cho/"},"imageURL":"https://github.com/johnycho.png","key":"johnycho"}],"frontMatter":{"slug":"spring-cloud-config-decrypt","title":"Spring Cloud Config\uc758 \ubcf5\ud638\ud654 \uc2e4\ud328 \ucc98\ub9ac \uacfc\uc815 \u2014 {cipher}...\uac00 invalid.*\ub85c \ubc14\ub00c\ub294 \uc774\uc720","authors":["johnycho"],"tags":["spring"]},"unlisted":false,"prevItem":{"title":"\uc138\ucee8\ub354\ub9ac \uc778\ub371\uc2a4\uc640 PK \uc778\ub371\uc2a4 \uac04 \ub370\ub4dc\ub77d, \uc65c \ubc1c\uc0dd\ud560\uae4c?","permalink":"/blog/index-deadlock"},"nextItem":{"title":"\ud83c\udf89 \uac1c\ubc1c \ube14\ub85c\uadf8 \uc624\ud508 \ud83c\udf89","permalink":"/blog/johny-dev-blog-launched"}},"content":"\x3c!-- truncate --\x3e\\n<br /><br />\\n\\n# Spring Cloud Config\uc758 \ubcf5\ud638\ud654 \uc2e4\ud328 \ucc98\ub9ac \uacfc\uc815 \u2014 {cipher}...\uac00 invalid.*\ub85c \ubc14\ub00c\ub294 \uc774\uc720\\nSpring Cloud Config Server\ub97c \uc4f0\ub2e4 \ubcf4\uba74,\\n\uc554\ud638\ud654\ub41c \uc124\uc815\uac12 `{cipher}...`\uac00 \ubcf5\ud638\ud654\uc5d0 \uc2e4\ud328\ud558\uba74\uc11c `invalid.my.secret` \ud615\ud0dc\ub85c \ub178\ucd9c\ub418\uace0,\\n\uacb0\uad6d \ub85c\uceec `application.properties`\uc758 \uac12\uc774 \uc801\uc6a9\ub418\ub294 \uacbd\uc6b0\uac00 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n\uc624\ub298\uc740 \uadf8 \ub0b4\ubd80 \uba54\ucee4\ub2c8\uc998\uc744 \ucf54\uc5b4 \ucf54\ub4dc \ub808\ubca8\uc5d0\uc11c\uae4c\uc9c0 \ub72f\uc5b4\ubcf4\ub824 \ud569\ub2c8\ub2e4.\\n\\n## \uc554\ud638\ud654\ub41c \uc124\uc815\uc774 \uc11c\ubc84\uc5d0 \uc804\ub2ec\ub418\ub294 \uad6c\uc870\\nConfig Server\ub294 Git, FileSystem, Vault \ub4f1\uc5d0\uc11c \uc124\uc815 \ud30c\uc77c\uc744 \uc77d\uace0,\\n`EnvironmentRepository.findOne()`\uc744 \ud1b5\ud574 \ud074\ub77c\uc774\uc5b8\ud2b8\uc5d0 `Environment` \uac1d\uccb4(JSON)\ub97c \ubc18\ud658\ud569\ub2c8\ub2e4.\\n\\n\uc774\ub54c \uc124\uc815\uac12 \uc911 `{cipher}...`\ub85c \uc2dc\uc791\ud558\ub294 \ud56d\ubaa9\uc774 \uc788\uc73c\uba74  \\n`EnvironmentController` \u2192 `EnvironmentRepository` \u2192 `EnvironmentEncryptor.decrypt()`\\n\ub2e8\uacc4\ub97c \uac70\uce58\uba70 \ubcf5\ud638\ud654\ub97c \uc2dc\ub3c4\ud569\ub2c8\ub2e4.\\n```java\\n// EnvironmentEncryptorEnvironmentRepository.java\\n@Override\\npublic Environment findOne(String name, String profiles, String label, boolean includeOrigin) {\\n    Environment environment = this.delegate.findOne(name, profiles, label, includeOrigin);\\n    if (this.environmentEncryptors != null) {\\n        for (EnvironmentEncryptor environmentEncryptor : environmentEncryptors) {\\n            environment = environmentEncryptor.decrypt(environment);\\n        }\\n    }\\n    if (!this.overrides.isEmpty()) {\\n        environment.addFirst(new PropertySource(\\"overrides\\", getOverridesMap(includeOrigin)));\\n    }\\n    return environment;\\n}\\n```\\n\uae30\ubcf8\uc801\uc73c\ub85c \uc544\ub798 \ub450 \uac1c\uc758 `EnvironmentEncryptor`\uac00 \uc874\uc7ac\ud569\ub2c8\ub2e4.\\n* `CipherEnvironmentEncryptor` (\uae30\ubcf8 RSA/Key \uae30\ubc18 \ubcf5\ud638\ud654)\\n* `VaultEnvironmentEncryptor` (HashiCorp Vault \uc5f0\ub3d9 \uc2dc)\\n\\n## \ubcf5\ud638\ud654 \uc2e4\ud328 \uc2dc `invalid.*` \ud0a4\ub85c \ubb34\ud6a8\ud654 \ucc98\ub9ac\\n`CipherEnvironmentEncryptor.decrypt()` \ub0b4\ubd80\ub97c \ubcf4\uba74,\\n\uac01 `PropertySource`\uc758 \ud0a4/\uac12\uc744 \uc21c\ud68c\ud558\uba70 `{cipher}` \uc811\ub450\uc5b4\uac00 \ubd99\uc740 \ud56d\ubaa9\uc744 \ubcf5\ud638\ud654\ud569\ub2c8\ub2e4.\\n\\n\ubcf5\ud638\ud654 \uc911 \uc608\uc678(`EncryptionOperationNotPossibleException`)\uac00 \ubc1c\uc0dd\ud558\uba74 \ub2e4\uc74c\uacfc \uac19\uc774 \ucc98\ub9ac\ub429\ub2c8\ub2e4.\\n```java\\n// CipherEnvironmentEncryptor.decrypt() \ucf54\ub4dc \uc694\uc57d\\ncatch (Exception e){\\n    if(this.prefixInvalidProperties) {\\n        value = \\"<n/a>\\";\\n        name = \\"invalid.\\" + name;\\n    }\\n    String message = \\"Cannot decrypt key: \\" + key + \\" (\\" + e.getClass() + \\": \\" + e.getMessage() + \\")\\";\\n}\\nmap.put(name, value);\\n```\\n\uc989, \uc6d0\ub798 \ud0a4 `my.secret` \ub300\uc2e0 `invalid.my.secret`\uc774 \ucd94\uac00\ub429\ub2c8\ub2e4.  \\n\uc774\ub54c \uae30\uc874 `my.secret` \ud0a4\ub294 \uc874\uc7ac\ud558\uc9c0 \uc54a\uc73c\ubbc0\ub85c, Config Client\ub294 \uc774 \uac12\uc744 \ubb34\uc2dc\ud558\uac8c \ub429\ub2c8\ub2e4.\\n\\n## \ud074\ub77c\uc774\uc5b8\ud2b8\uc5d0\uc11c `invalid.*` \uac00 \ubb34\uc2dc\ub418\ub294 \uc774\uc720\\nConfig Client\uac00 \uc11c\ubc84\ub85c\ubd80\ud130 \ubc1b\uc740 \uc124\uc815\uc744 `Environment`\ub85c \uba38\uc9c0\ud560 \ub54c,\\n`PropertySourcesPropertyResolver`\uac00 \uc21c\uc11c\ub300\ub85c `PropertySource`\ub97c \uc21c\ud68c\ud558\uba70 \uac12\uc744 \ucc3e\uc2b5\ub2c8\ub2e4.\\n1.\\t\uba3c\uc800 `configserver:*` `PropertySource`\ub97c \ud0d0\uc0c9\\n2.\\t`{cipher}` \ubcf5\ud638\ud654 \uc2e4\ud328 \u2192 `invalid.my.secret`\ub9cc \uc874\uc7ac\\n3.\\t\ucc3e\uc9c0 \ubabb\ud558\uba74 \ub2e4\uc74c `PropertySource` (\ub85c\uceec \ud30c\uc77c \ub4f1)\ub85c fall-through\\n4.\\t`application.properties`\uc5d0\uc11c `my.secret=localValue` \ubc1c\uacac \u2192 \ubc18\ud658 \u2705\\n\\n\uc989, `invalid.*` \ud0a4\ub294 <mark>**\ub2e8\uc9c0 \uc2e4\ud328 \ud754\uc801\uc77c \ubfd0**</mark>, `Environment`\uc5d0\uc11c\ub294 <mark>**\ucc38\uc870\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.**</mark>\\n\\n\uc774 \ub3d9\uc791\uc740 `AbstractEnvironment` \ub0b4\ubd80\uc5d0\uc11c merge\ub420 \ub54c, \ub2e8\uc21c\ud788 `PropertySource` \uc21c\uc11c\ub300\ub85c \ubd99\uae30 \ub54c\ubb38\uc5d0\\n\ud2b9\ubcc4\ud55c \uc608\uc678\ucc98\ub9ac \uc5c6\uc774 <mark>\u201c\ub4a4\uc5d0 \uc624\ub294 `PropertySource`\uac00 \uc6b0\uc120\uad8c\uc744 \uac00\uc9c4\ub2e4\u201d</mark>\ub294 \uc77c\ubc18 \uaddc\uce59\uc73c\ub85c \ud574\uacb0\ub429\ub2c8\ub2e4."},{"id":"johny-dev-blog-launched","metadata":{"permalink":"/blog/johny-dev-blog-launched","source":"@site/blog/2025-02-03-johny-dev-blog-launched.mdx","title":"\ud83c\udf89 \uac1c\ubc1c \ube14\ub85c\uadf8 \uc624\ud508 \ud83c\udf89","description":"_","date":"2025-02-03T00:00:00.000Z","tags":[{"inline":false,"label":"Hello","permalink":"/blog/tags/hello","description":"Hello tag description"}],"readingTime":2.82,"hasTruncateMarker":true,"authors":[{"name":"Johny Cho","title":"Back End Engineer @ NHN","url":"https://github.com/johnycho","page":{"permalink":"/blog/authors/johnycho"},"socials":{"github":"https://github.com/johnycho","instagram":"https://www.instagram.com/johny__cho","linkedin":"https://www.linkedin.com/in/johny-cho/"},"imageURL":"https://github.com/johnycho.png","key":"johnycho"}],"frontMatter":{"slug":"johny-dev-blog-launched","title":"\ud83c\udf89 \uac1c\ubc1c \ube14\ub85c\uadf8 \uc624\ud508 \ud83c\udf89","authors":["johnycho"],"tags":["hello"]},"unlisted":false,"prevItem":{"title":"Spring Cloud Config\uc758 \ubcf5\ud638\ud654 \uc2e4\ud328 \ucc98\ub9ac \uacfc\uc815 \u2014 {cipher}...\uac00 invalid.*\ub85c \ubc14\ub00c\ub294 \uc774\uc720","permalink":"/blog/spring-cloud-config-decrypt"}},"content":"import BrowserOnly from \'@docusaurus/BrowserOnly\';\\n\\n___\\n\\n# \ud14c\uc2a4\ud2b8 \ub9c8\ud06c \ub2e4\uc6b4 \ubb38\uc11c\ub97c \uc791\uc131\ud574\ubd05\ub2c8\ub2e4..\\n\\n\x3c!-- truncate --\x3e\\n\\n## :heavy_check_mark:\ufe0f Glorious Demo with TypeScript\\n---\\n\uc544\ub798\ub294 `glorious-demo`\ub97c \uc774\uc6a9\ud55c \uc5d0\ub514\ud130 + \ud130\ubbf8\ub110 \uc560\ub2c8\uba54\uc774\uc158 \uc608\uc81c\uc785\ub2c8\ub2e4.\\n\\n<BrowserOnly fallback={<p>Loading terminal...</p>}>\\n{() => {\\nconst GloriousTerminal = require(\'@site/src/components/GloriousTerminal\').default;\\nreturn (\\n<GloriousTerminal\\ncode={`\\nfunction greet(){\\nconsole.log(\\"Hello World!\\");\\n}\\n\\ngreet();\\n`}\\ncommand=\\"node ./demo\\"\\nresponse=\\"Hello World!\\"\\n/>\\n);\\n}}\\n</BrowserOnly>\\n\\n<br /><br /><br /><br /><br /><br />\\n\\n## :heavy_check_mark: Javascript \ucf54\ub4dc \ube14\ub7ed\\n---\\n\\n```js\\n<button onClick={() => alert(\'button clicked!\')}>Click me!</button>\\n```\\n\\n## :heavy_check_mark: Java \ucf54\ub4dc \ube14\ub7ed\\n---\\n\\n```java\\npackage com.nhn.meta.banword.application;\\n\\nimport java.util.Arrays;\\nimport java.util.Collections;\\nimport java.util.Map;\\nimport java.util.stream.Collectors;\\n\\npublic class Solution {\\n\\n  public static void main(String[] args) {\\n// \ud14c\uc2a4\ud2b8 \ucf00\uc774\uc2a4 \uc2e4\ud589 \ubc0f \uacb0\uacfc \ucd9c\ub825\\n    System.out.println(\\"Test Case 1 Result: \\" + solution(2, \\"1A 2F 1C\\") + \\" (Expected: 2)\\");\\n    System.out.println(\\"Test Case 2 Result: \\" + solution(3, \\"\\") + \\" (Expected: 6)\\");\\n    System.out.println(\\n        \\"Test Case 3 Result: \\" + solution(1, \\"1A 1B 1C 1D 1E 1F 1G 1H 1J 1K\\") + \\" (Expected: 0)\\");\\n    System.out.println(\\n        \\"Test Case 4 Result: \\" + solution(50, \\"1A 3C 2B 20G 5A 7K 40D 50H\\") + \\" (Expected: 95)\\");\\n    System.out.println(\\n        \\"Test Case 5 Result: \\" + solution(2, \\"1A 1C 1D 1F 1G 1J 2C 2H\\") + \\" (Expected: 1)\\");\\n    System.out.println(\\n        \\"Test Case 6 Result: \\" + solution(22, \\"1A 3C 2B 20G 5A\\") + \\" (Expected: 41)\\");\\n  }\\n\\n  public static int solution(int N, String S) {\\n    final Map<String, Boolean> reserved = splitStringToMap(S);\\n\\n    int maxFamilies = 0;\\n\\n    for (int row = 1; row <= N; row++) {\\n      boolean leftAndCenter =\\n          !reserved.containsKey(row + \\"B\\") &&\\n              !reserved.containsKey(row + \\"C\\") &&\\n              !reserved.containsKey(row + \\"D\\") &&\\n              !reserved.containsKey(row + \\"E\\");\\n\\n      boolean centerOnly =\\n          !reserved.containsKey(row + \\"D\\") &&\\n              !reserved.containsKey(row + \\"E\\") &&\\n              !reserved.containsKey(row + \\"F\\") &&\\n              !reserved.containsKey(row + \\"G\\");\\n\\n      boolean centerAndRight =\\n          !reserved.containsKey(row + \\"F\\") &&\\n              !reserved.containsKey(row + \\"G\\") &&\\n              !reserved.containsKey(row + \\"H\\") &&\\n              !reserved.containsKey(row + \\"J\\");\\n\\n      int familiesAdded = 0; // \ub514\ubc84\uae45\uc6a9 \ucd94\uac00\\n      if (leftAndCenter) {\\n        maxFamilies++;\\n        familiesAdded++;\\n      }\\n\\n      if (centerAndRight) {\\n        maxFamilies++;\\n        familiesAdded++;\\n      }\\n\\n      if (!leftAndCenter && !centerAndRight && centerOnly) {\\n        maxFamilies++;\\n        familiesAdded++;\\n      }\\n\\n      // \ud589\ubcc4\ub85c \ucd94\uac00\ub41c \uac00\uc871 \uc218 \ucd9c\ub825\\n      System.out.printf(\\n          \\"Row %d: leftAndCenter=%b, centerOnly=%b, centerAndRight=%b, Families added=%d\\\\n\\",\\n          row, leftAndCenter, centerOnly, centerAndRight, familiesAdded);\\n    }\\n\\n    return maxFamilies;\\n  }\\n\\n  public static Map<String, Boolean> splitStringToMap(String s) {\\n    if (s == null || s.trim().isEmpty()) {\\n      return Collections.emptyMap(); // \ubb38\uc790\uc5f4\uc774 \ube44\uc5b4\uc788\uc73c\uba74 \ube48 \ub9f5 \ubc18\ud658\\n    }\\n\\n    // \uacf5\ubc31 \uae30\uc900\uc73c\ub85c \ub098\ub208 \ud6c4, \uac01 \ub2e8\uc5b4\ub97c \ud0a4\ub85c, \ub2e8\uc5b4\uc758 \uae38\uc774\ub97c \uac12\uc73c\ub85c \ub9f5\uc5d0 \uc800\uc7a5\\n    return Arrays.stream(s.split(\\"\\\\\\\\s+\\")) // \uacf5\ubc31 \uae30\uc900\uc73c\ub85c \ubb38\uc790\uc5f4 \ubd84\ub9ac\\n        .filter(word -> !word.isEmpty()) // \ube44\uc5b4 \uc788\ub294 \ubb38\uc790\uc5f4 \uc81c\uac70\\n        .collect(Collectors.toMap(word -> word, word -> true));\\n  }\\n}\\n```\\n\\n## :heavy_check_mark: Task List\\n---\\n\\n- [x] Write the press release\\n- [ ] Update the website\\n- [ ] Contact the media\\n\\n## :heavy_check_mark: Using Emoji Shortcodes\\n---\\nGone camping! :tent: Be back soon.\\n\\nThat is so funny! :joy:\\n\\n## :heavy_check_mark: Highlight\\n---\\nI need to highlight these <mark>very important words</mark>.\\n\\n## :heavy_check_mark: Table\\n---\\n\\n| Syntax    | Description |\\n|-----------|-------------|\\n| Header    | Title       |\\n| Paragraph | Text        |"}]}}')}}]);